define('text!css/main.css', ['module'], function(module) { module.exports = "\n#tiles {\n    list-style-type: none;\n    position: relative; /** Needed to ensure items are laid out relative to this container **/\n    margin: 0;\n    padding: 0;\n}\n#tiles li:hover img{\n    opacity:0.8;\n}\n/**\n * Grid items\n */\n#tiles li {\n    width: 280px;\n    background-color: #ffffff;\n    border: 1px solid #dedede;\n    border-radius: 2px;\n    -moz-border-radius: 2px;\n    -webkit-border-radius: 2px;\n    display: none;\n    cursor: pointer;\n    border-radius: 0.2em;\n}\n#tiles li img{\n    border-top-left-radius:0.2em;\n    border-top-right-radius:0.2em;\n}\n#tiles li.inactive {\n    visibility: hidden;\n    opacity: 0;\n}\n\n#tiles li img {\n    display: block;\n}\n\n"; });
define('text!blog.html', ['module'], function(module) { module.exports = "<template>\n    <require from=\"resources/value-converters/dateformat\"></require>\n    <require from=\"resources/attributes/wookmark\"></require>\n    <div class=\"container wow fadeIn\" id=\"test\">\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12\">\n                    <hr>\n                    <h2 class=\"intro-text text-center\">Company\n                        <strong>blog</strong>\n                    </h2>\n                    <hr>\n                </div>\n                <div class=\"col-lg-12 text-center\" repeat.for=\"post of displayedPosts\" >\n                    <img class=\"img-responsive img-border img-full\" src=${post.url} alt=\"\">\n                    <h2>Post Title\n                        <br>\n                        <small>${post.date | dateFormat} </small>\n                    </h2>\n                    <p>${post.body}</p>\n                    <a href=\"blog/${post.id}\" class=\"btn btn-default btn-lg\">Read More</a>\n                    <hr>\n                </div>\n                <div class=\"col-lg-12 text-center\">\n                    <ul class=\"pager\">\n                        <li class=\"previous\"><a href=\"#\" click.delegate=\"page($event, 'increment')\" >&larr; Older </a>\n                        </li>\n                        <li class=\"next\"><a href=\"#\" click.delegate=\"page($event, 'decrement')\" >Newer &rarr;</a>\n                        </li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n    </div>\n    <!-- /.container -->\n</template>"; });
define('text!contact.html', ['module'], function(module) { module.exports = "<template>\n\n    <require from=\"resources/elements/validation-summary.html\"></require>\n\n    <div class=\"container wow fadeIn\">\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12\">\n                    <hr>\n                    <h2 class=\"intro-text text-center\">Contact\n                        <strong>${businessName}</strong>\n                    </h2>\n                    <hr>\n                </div>\n                <div class=\"col-md-8 wow fadeInUp\">\n                    <!-- Embedded Google Map using an iframe - to select your location find it on Google maps and paste the link as the iframe src. If you want to use the Google Maps API instead then have at it! -->\n                    <iframe width=\"100%\" height=\"400\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps?hl=en&amp;ie=UTF8&amp;ll=37.0625,-95.677068&amp;spn=56.506174,79.013672&amp;t=m&amp;z=4&amp;output=embed\"></iframe>\n                </div>\n                <div class=\"col-md-4\">\n                    <p><i class=\"glyphicon glyphicon-earphone\"></i>\n                        <strong>${aData.phone}</strong>\n                    </p>\n                    <p><i class=\"glyphicon glyphicon-globe\"></i>\n                        <strong>${aData.streetAdr}\n                            <br>${aData.city}, ${aData.state} ${aData.zip}</strong>\n                    </p>\n                </div>\n                <div class=\"clearfix\"></div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12\">\n                    <hr>\n                    <h2 class=\"intro-text text-center\">Contact\n                        <strong>form</strong>\n                    </h2>\n                    <hr>\n                    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Fugiat, vitae, distinctio, possimus repudiandae cupiditate ipsum excepturi dicta neque eaque voluptates tempora veniam esse earum sapiente optio deleniti consequuntur eos voluptatem.</p>\n                    <form role=\"form\" validation-renderer=\"bootstrap-form\" validation-errors.bind=\"errors\">\n\n                        <validation-summary errors.bind=\"errors\"\n                                            autofocus.bind=\"validationController.validateTrigger === 'manual'\">\n                        </validation-summary>\n\n                        <div class=\"row\">\n                            <div class=\"form-group col-lg-4\">\n                                <label>Name</label>\n                                <input type=\"text\" placeholder=\"name\" class=\"form-control\" value.bind=\"message.name & validate\">\n                            </div>\n                            <div class=\"form-group col-lg-4\">\n                                <label>Email Address</label>\n                                <input type=\"text\" placeholder=\"email\" class=\"form-control\" value.bind=\"message.email & validate\">\n                            </div>\n                            <div class=\"form-group col-lg-4\">\n                                <label>Phone Number</label>\n                                <input type=\"tel\" placeholder=\"555-555-5555\" class=\"form-control\" value.bind=\"message.phone\">\n                            </div>\n                            <div class=\"clearfix\"></div>\n                            <div class=\"form-group col-lg-12\">\n                                <label>Message</label>\n                                <textarea class=\"form-control\" name=\"message\" rows=\"6\" value.bind=\"message.message & validate\"></textarea>\n                            </div>\n                            <div class=\"form-group col-lg-12\">\n                                <input type=\"hidden\" name=\"save\" value=\"contact\">\n                                <ul class=\"content p-red\">\n                                    <button href=\"\" click.delegate=\"send(message)\" class=\"btn btn-danger btn-outline btn-lg\">\n                                        <i class=\"glyphicon glyphicon-send\"></i> Send\n                                    </button>\n                                </ul>\n                            </div>\n                        </div>\n                    </form>\n                </div>\n            </div>\n        </div>\n\n    </div>\n    <!-- /.container -->\n</template>\n"; });
define('text!home.html', ['module'], function(module) { module.exports = "<template>\n    <require from=\"resources/elements/testimonials\"></require>\n\n    <div class=\"container wow fadeIn\">\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12 text-center\">\n                    <div id=\"carousel-example-generic\" class=\"carousel slide\">\n                        <!-- Indicators -->\n                        <ol class=\"carousel-indicators hidden-xs\">\n                            <li data-target=\"#carousel-example-generic\" data-slide-to=\"0\" class=\"active\"></li>\n                            <li data-target=\"#carousel-example-generic\" data-slide-to=\"1\"></li>\n                            <li data-target=\"#carousel-example-generic\" data-slide-to=\"2\"></li>\n                        </ol>\n\n                        <!-- Wrapper for slides -->\n                        <div class=\"carousel-inner\">\n                            <div class=\"item active\">\n                                <img class=\"img-responsive img-full\" src=\"src/img/slide-1.jpg\" alt=\"\">\n                            </div>\n                            <div class=\"item\">\n                                <img class=\"img-responsive img-full slide\" src=\"src/img/slide-2.jpg\" alt=\"\">\n                            </div>\n                            <div class=\"item\">\n                                <img class=\"img-responsive img-full\" src=\"src/img/slide-3.jpg\" alt=\"\">\n                            </div>\n                        </div>\n\n                        <!-- Controls -->\n                        <a class=\"left carousel-control\" href=\"#carousel-example-generic\" data-slide=\"prev\">\n                            <span class=\"icon-prev\"></span>\n                        </a>\n                        <a class=\"right carousel-control\" href=\"#carousel-example-generic\" data-slide=\"next\">\n                            <span class=\"icon-next\"></span>\n                        </a>\n                    </div>\n                    <h2 class=\"brand-before\">\n                        <small>Welcome to</small>\n                    </h2>\n                    <h1 class=\"brand-name\">${businessName}</h1>\n                    <hr class=\"tagline-divider\">\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12\">\n                    <hr>\n                    <h2 class=\"intro-text text-center\">Something something\n                        <strong>About Junksters</strong>\n                    </h2>\n                    <hr>\n                    <img class=\"img-responsive img-border img-left\" src=\"src/img/intro-pic.jpg\" alt=\"\">\n                    <hr class=\"visible-xs\">\n                    <p>The boxes used in this template are nested inbetween a normal Bootstrap row and the start of your column layout. The boxes will be full-width boxes, so if you want to make them smaller then you will need to customize.</p>\n                    <p>A huge thanks to <a href=\"http://join.deathtothestockphoto.com/\" target=\"_blank\">Death to the Stock Photo</a> for allowing us to use the beautiful photos that make this template really come to life. When using this template, make sure your photos are decent. Also make sure that the file size on your photos is kept to a minumum to keep load times to a minimum.</p>\n                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc placerat diam quis nisl vestibulum dignissim. In hac habitasse platea dictumst. Interdum et malesuada fames ac ante ipsum primis in faucibus. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.</p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"box\">\n                <div class=\"col-lg-12\">\n                    <hr>\n                    <h2 class=\"intro-text text-center\">What people are\n                        <strong>saying about us</strong>\n                    </h2>\n                    <hr>\n                    <testimonials view-model.ref=\"testimonials\"></testimonials>\n                </div>\n            </div>\n        </div>\n\n    </div>\n    <!-- /.container -->\n    <script>\n        $('.carousel').carousel({\n            interval: 5000 //changes the speed\n        })\n    </script>\n</template>"; });
